                            dollarUSLocale.format(v.value)
                          ).toFixed(2)}
                        </td>
                      );
                    })}
                  </tr>

                  <tr>
                    <td className="td-data">
                      {costOfSalesData[4].businessSegmentNameEn}
                    </td>
                    {costOfSalesData[4].periodicValues.map((v) => {
                      return (
                        <td className="td-data">
                          {" "}
                          {Number.parseFloat(
                            dollarUSLocale.format(v.value)
                          ).toFixed(2)}
                        </td>
                      );
                    })}
                  </tr>
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Businesssegmentstabs;
